import React from 'react' ;
import { Link } from 'react-router-dom'

class Login extends React.Component{
	constructor(props){
		super(props);
		this.state = {user: []};
	}
  	componentDidMount() {
		fetch('http://amigoview.com/iosdemo/login.php', {
			method: 'POST',
			body: JSON.stringify({
				email: 'New title added',
				password: 'New body added. Hello body.',
				userId: 2
			}),
			headers: {
				"Content-type": "application/json; charset=UTF-8"
			}
		}).then(response => {
				return response.json()
			}).then(json => {
				this.setState({
					user:json
				});
			});
	}
	render(){
		return (
			<div className="login-form">
				<form action="action_page.php" method="post">

				  <div className="container">
				    <label for="uname"><b>Username</b></label>
				    <input type="text" placeholder="Enter Username" name="uname" required />

				    <label for="psw"><b>Password</b></label>
				    <input type="password" placeholder="Enter Password" name="psw" required />

				    <button type="submit">Login</button>
				    <label>
				      <input type="checkbox" checked="checked" name="remember" /> Remember me
				    </label>
				  </div>

				  <div className="container cancel-panel" style={{background:"#f1f1f1"}}>
				  	<div className="cancelbtn-div"><button type="button" className="cancelbtn">Cancel</button></div>
				    <div className="register"><span className="psw">Don't have account <Link to={'/register'}>Register Here</Link></span></div>
				    <div className="forgotpsw"><span className="psw">Forgot <Link to={'#'}>password?</Link></span></div>
				  </div>
				</form>
			</div>
		)
	}
}

export default Login
